import React from 'react';
import Navbar from './components/navbar';
import './Home.css';
import ItemList from './components/itemList';
class Home extends React.Component<{}, {}> {
  public render() {
    return (
      <div className="Home">
        <Navbar/>
        <ItemList/>
      </div>
    );
  }
}

export default Home;
